import './App.css';
const fruits = ["apple", "orange", "banana", "pear", "laichi", "strawberry"];
const [a, b, c, ...other] = fruits;
// equivalent to
// const a = fruits[0];
// const b = fruits[1];
// const c = fruits[2];

const employees = [
  { id: 1, name: 'Alice', country: 'Austria' },
  { id: 2, name: 'Bob', country: 'Belgium' },
  { id: 3, name: 'Carl', country: 'Canada' },
  { id: 4, name: 'Dean', country: 'Denmark' },
  { id: 5, name: 'Ethan', country: 'Egypt' },
];

function Fruit() {
  return (
    <>
      {fruits.map(el => {
        return (
          <div>{el}</div>
        );
      })}
    </>

  );

}

function Listing(props) {
  return (
    <div key={props.id}>
      <h2>name: {props.name}</h2>
      <h2>country: {props.country}</h2>
      <hr />
    </div>
  );
}
function Employee() {
  const results = [];
  const employeesReversed = employees.slice().reverse();
  for (const employee of employeesReversed) {
    if (employee.id != 1) {
      results.push(
        <div key={employee.id}>
          <h2>name: {employee.name}</h2>
          <h2>country: {employee.country}</h2>

          <hr />
        </div>
      );
    }
  }

  return (
    <div className="hi">
      {results}
    </div>
  );
}

function Employee1() {
  return (
    <>
      {employees.map(element => {
        return (
          <div>
            <h2>name: {element.name}</h2>
            <h2>country: {element.country}</h2>
            <hr />
          </div>
        );
      })}
    </>
  );
}

function App() {
  return (
    <>
      <Employee1 />
      <Fruit />
      <Employee />
    </>
  );
}

export default App;
